import "./Item.css";
import Date from "./Date";
function Item(props) {
  return (
    <div className="basic">
      <div className="item">
        <Date date={props.date}></Date>
        <p className="name">{props.name}</p>
        <p className="price">${props.price}</p>
      </div>
      <br></br>
    </div>
  );
}
export default Item;
